('2c9180945109b4c9015109b4ca31003e', TIMESTAMP '2013-09-10 00:00:00.0', 'your Majesties realme arrived, there is none in comparison to bee ', 'email'),
('2c9180945109b4c9015109b4ca31003f', TIMESTAMP '2013-11-10 00:00:00.0', 'Conestables: thei made after to come together, all the Romain men apte ', 'phone'),
('2c9180945109b4c9015109b4ca440058', TIMESTAMP '2013-06-22 00:00:00.0', 'immense. Nothing is so trivial as to be left inexact. ', 'email'),
('2c9180945109b4c9015109b4ca450059', TIMESTAMP '2013-06-10 00:00:00.0', 'FABRICIO. To honour, and to reward vertue, not to despise povertie, to ', 'email'),
('2c9180945109b4c9015109b4ca4d0063', TIMESTAMP '2013-08-08 00:00:00.0', '    before they tasted the blowes of the outlandish warre, that it ', 'email'),
('2c9180945109b4c9015109b4ca4d0064', TIMESTAMP '2013-08-29 00:00:00.0', 'unarmed prophet such as Savonarola was foredoomed to failure. In such ', 'phone'),
('2c9180945109b4c9015109b4ca4e0065', TIMESTAMP '2014-03-04 00:00:00.0', 'to the yeres, and to the qualitie of the man, notwithstandyng, in as moche as hath comen into my mynde: there remaineth in me ', 'phone'),
('2c9180945109b4c9015109b4ca4e0066', TIMESTAMP '2013-12-20 00:00:00.0', 'that you should shewe, howe the horsemen can be withstoode of footemen, ', 'phone'),
('2c9180945109b4c9015109b4ca55006d', TIMESTAMP '2014-05-03 00:00:00.0', 'Roman Court, but that more abuse should not be merited, seeing it is an absolute question of the ', 'phone'),
('2c9180945109b4c9015109b4ca6c0089', TIMESTAMP '2014-06-02 00:00:00.0', 'some rewarde, whereby thei maie bee more contented, and better bee ', 'email'),
('2c9180945109b4c9015109b4ca6c008a', TIMESTAMP '2013-12-04 00:00:00.0', 'prevaile in the tyme of warre, that in peace thei maie bee able to paie the lesse nomber, and for this ', 'phone'),
('2c9180945109b4c9015109b4ca6c008b', TIMESTAMP '2014-10-08 00:00:00.0', 'contemplate the life of Souldiours, of other ', 'phone'),
('2c9180945109b4c9015109b4ca6d008c', TIMESTAMP '2015-02-16 00:00:00.0', 'trustyng on the same, shall make us to lese our state, or it shall be ', 'phone'),
('2c9180945109b4c9015109b4ca8600ab', TIMESTAMP '2014-06-18 00:00:00.0', 'Nor were there any hills from which salvation might be looked for. ', 'phone'),
('2c9180945109b4c9015109b4ca8600ac', TIMESTAMP '2014-01-25 00:00:00.0', '       * ', 'email'),
('2c9180945109b4c9015109b4ca8600ad', TIMESTAMP '2013-07-03 00:00:00.0', 'and discipline of an army in being. He pictures the horror, waste, and ', 'phone'),
('2c9180945109b4c9015109b4ca8600ae', TIMESTAMP '2014-12-14 00:00:00.0', 'strong central unifying government was imperative, and at that day such ', 'email'),
('2c9180945109b4c9015109b4caaf00e2', TIMESTAMP '2014-09-29 00:00:00.0', 'COSIMO. What number would you make? and how would you arme them? ', 'email'),
('2c9180945109b4c9015109b4caaf00e3', TIMESTAMP '2013-04-24 00:00:00.0', 'should not withstande it: for that concernyng the discorde emong theim ', 'phone'),
('2c9180945109b4c9015109b4cab000e4', TIMESTAMP '2014-08-24 00:00:00.0', 'requisite to every band of men, 91 ', 'email'),
('2c9180945109b4c9015109b4cab000e5', TIMESTAMP '2014-05-14 00:00:00.0', 'Targaet, the armes and the legges armed, is moche more apt to defende ', 'email'),
('2c9180945109b4c9015109b4cabe00f8', TIMESTAMP '2013-06-28 00:00:00.0', 'Church has maintained, and still maintains Italy divided.'' The Papacy is ', 'email'),
('2c9180945109b4c9015109b4cabf00f9', TIMESTAMP '2014-12-13 00:00:00.0', 'whiche then was his capitaine. He with sixe thousande horse, and a coward upon a good, whereby it ', 'email');          
INSERT INTO PUBLIC.ACTIVITY(ID, DATE, DESCRIPTION, TYPE) VALUES
('2c9180945109b4c9015109b4cac000fa', TIMESTAMP '2015-01-09 00:00:00.0', 'found it, in the Roman Republic. The memory and even the substance of ', 'email'),
('2c9180945109b4c9015109b4cac000fb', TIMESTAMP '2013-03-23 00:00:00.0', 'defence, maintenaunce, and advauncemente of a Kyngdome, or Common weale, ', 'email'),
('2c9180945109b4c9015109b4cac000fc', TIMESTAMP '2015-01-20 00:00:00.0', 'common weale lived unspotted, never any noble Citezein would presume, by ', 'email'),
('2c9180945109b4c9015109b4cacb0109', TIMESTAMP '2013-03-16 00:00:00.0', '[Sidenote: The Art of War; and The Prince ', 'phone'),
('2c9180945109b4c9015109b4cae00122', TIMESTAMP '2013-09-28 00:00:00.0', 'were in plenty, and works of the learned men led by Aretino, written in ', 'phone'),
('2c9180945109b4c9015109b4cae00123', TIMESTAMP '2013-09-20 00:00:00.0', 'COSIMO. You have made me to esteme this arte of warfare almoste as ', 'email'),
('2c9180945109b4c9015109b4cae00124', TIMESTAMP '2013-08-09 00:00:00.0', 'Machiavelli considers the best method of subjugating Free Cities. Here ', 'phone'),
('2c9180945109b4c9015109b4cb080158', TIMESTAMP '2014-08-25 00:00:00.0', 'other, that thou canst not without their moste grevous losse, gather ', 'phone'),
('2c9180945109b4c9015109b4cb080159', TIMESTAMP '2014-08-11 00:00:00.0', 'that in peace thei maie bee more contented, and better bee ', 'email'),
('2c9180945109b4c9015109b4cb08015a', TIMESTAMP '2014-08-07 00:00:00.0', STRINGDECODE('this ''honn\u00eate homme et bon citoyen'' as ''le livre des R\u00e9publicains,'' and '), 'email'),
('2c9180945109b4c9015109b4cb08015b', TIMESTAMP '2013-02-17 00:00:00.0', 'of his countrie, will ', 'email'),
('2c9180945109b4c9015109b4cb09015c', TIMESTAMP '2013-07-11 00:00:00.0', 'slingers did, and the Crosseboweshoters. This maner of arming, was found ', 'email'),
('2c9180945109b4c9015109b4cb25018a', TIMESTAMP '2013-09-14 00:00:00.0', 'beginning the staciones of ordinarie Souldiours, had appoincted over the ', 'email'),
('2c9180945109b4c9015109b4cb3901a3', TIMESTAMP '2014-02-05 00:00:00.0', 'the raw material, the State is the finished work. Further you are to ', 'email'),
('2c9180945109b4c9015109b4cb3901a4', TIMESTAMP '2013-10-10 00:00:00.0', 'for all, but for the great ones there is licence. And when the day of ', 'phone'),
('2c9180945109b4c9015109b4cb5501d2', TIMESTAMP '2013-03-18 00:00:00.0', 'Piero, and Totto: I wish I knew his eyes were getting well. Be happy and ', 'email'),
('2c9180945109b4c9015109b4cb700209', TIMESTAMP '2014-08-08 00:00:00.0', 'onely shal be occasion to unite them: bicause this order giveth them ', 'phone'),
('2c9180945109b4c9015109b4cb70020a', TIMESTAMP '2014-10-04 00:00:00.0', 'FABRICIO. But for that I shall have pleasure, not to leave ', 'email'),
('2c9180945109b4c9015109b4cb81022f', TIMESTAMP '2015-02-17 00:00:00.0', 'experience enough within this XXV. yeres. And the insamples of their ', 'phone'),
('2c9180945109b4c9015109b4cb810230', TIMESTAMP '2015-01-06 00:00:00.0', 'in your mynde any doubt. I will begin at your woordes, where you saied ', 'email'),
('2c9180945109b4c9015109b4cb910252', TIMESTAMP '2013-11-29 00:00:00.0', 'come before me twentie young men of good stature, with what rule I ought ', 'phone'),
('2c9180945109b4c9015109b4cbaa028f', TIMESTAMP '2014-11-09 00:00:00.0', 'the book is a primer of despotism and Rome, and a grammar for bigots and ', 'email'),
('2c9180945109b4c9015109b4cbaa0290', TIMESTAMP '2014-03-03 00:00:00.0', 'footemen, went to mete with them, and incounteryng theim, he was ', 'email'),
('2c9180945109b4c9015109b4cbaf029a', TIMESTAMP '2013-09-22 00:00:00.0', 'also the necessarie use thereof so manifeste, that even Ladie Peace her ', 'email'),
('2c9180945109b4c9015109b4cbb702a4', TIMESTAMP '2013-12-19 00:00:00.0', 'Souldiers ought to bee had above all thynges, to his customes, and ', 'email'),
('2c9180945109b4c9015109b4cbb702a5', TIMESTAMP '2013-11-26 00:00:00.0', 'other, shall see, how the unarmed, shall have no maner of thing, whiche lesse agreeth the one with the other, nor ', 'email');    
INSERT INTO PUBLIC.ACTIVITY(ID, DATE, DESCRIPTION, TYPE) VALUES
('2c9180945109b4c9015109b4cbb702a6', TIMESTAMP '2013-09-28 00:00:00.0', 'whiche the Romaine people gave to their Citezeins was, that thei should ', 'phone'),
('2c9180945109b4c9015109b4cbd202dd', TIMESTAMP '2013-05-06 00:00:00.0', '               olde time, were the formost amongst the fighters, going armed on ', 'email'),
('2c9180945109b4c9015109b4cbd202de', TIMESTAMP '2014-12-05 00:00:00.0', 'Whereof cometh the utilitie, and the dissorder of the armies that are ', 'phone'),
('2c9180945109b4c9015109b4cbd202df', TIMESTAMP '2013-04-21 00:00:00.0', 'the insolence of theim grewe, that they became fearful unto the Senate, ', 'phone'),
('2c9180945109b4c9015109b4cbd302e0', TIMESTAMP '2014-07-01 00:00:00.0', 'was a failure: but he was the Antichrist of Rome and he ', 'email'),
('2c9180945109b4c9015109b4cbd302e1', TIMESTAMP '2013-11-20 00:00:00.0', 'moche felicitie he did describe his conceiptes, and how moche for ', 'email'),
('2c9180945109b4c9015109b4cbe50303', TIMESTAMP '2013-10-15 00:00:00.0', 'weightiest thinkers in the field of military construction and ', 'email'),
('2c9180945109b4c9015109b4cbe60304', TIMESTAMP '2013-03-05 00:00:00.0', 'conception and foundation of such a separation in politics, ethics, and religion that the ', 'email'),
('2c9180945109b4c9015109b4cbe60305', TIMESTAMP '2013-07-28 00:00:00.0', 'candour of the time Guicciardini could say that he loathed the Papacy ', 'phone'),
('2c9180945109b4c9015109b4cbf5031e', TIMESTAMP '2014-06-12 00:00:00.0', 'of Macedonia, I do not remember, that there is no service ', 'phone'),
('2c9180945109b4c9015109b4cbf5031f', TIMESTAMP '2014-04-30 00:00:00.0', 'and armes, covered with greaves, and vambraces, with a targaet on the ', 'phone'),
('2c9180945109b4c9015109b4cbf60320', TIMESTAMP '2014-09-14 00:00:00.0', 'and peace hangeth theim up? For as moche as ', 'email'),
('2c9180945109b4c9015109b4cc010339', TIMESTAMP '2014-07-17 00:00:00.0', STRINGDECODE('[Sidenote: C\u00e6sar Borgia.] '), 'email'),
('2c9180945109b4c9015109b4cc01033a', TIMESTAMP '2014-01-22 00:00:00.0', 'ulcer, sparing neither to himself or to his patient. And if he may not ', 'phone'),
('2c9180945109b4c9015109b4cc02033b', TIMESTAMP '2014-07-05 00:00:00.0', STRINGDECODE('    Ch\u00e8 l''antico valore '), 'phone'),
('2c9180945109b4c9015109b4cc02033c', TIMESTAMP '2014-11-27 00:00:00.0', 'of thesame nor thesame service cannot bee prepared, but in this maner: ', 'email'),
('2c9180945109b4c9015109b4cc18036a', TIMESTAMP '2015-01-01 00:00:00.0', 'for that in this the ', 'email'),
('2c9180945109b4c9015109b4cc18036b', TIMESTAMP '2014-01-13 00:00:00.0', 'In what place a Capitain maie order his armie with savegarde not to be made by ', 'phone'),
('2c9180945109b4c9015109b4cc19036c', TIMESTAMP '2013-06-04 00:00:00.0', 'been spared the sight of. And what he saw, he saw not through a glass ', 'phone'),
('2c9180945109b4c9015109b4cc19036d', TIMESTAMP '2013-04-27 00:00:00.0', 'they were the beste appointed armies, that ever were: and Titus Livius ', 'email'),
('2c9180945109b4c9015109b4cc19036e', TIMESTAMP '2013-06-11 00:00:00.0', 'bryng it to any aunciente ende: whereupon I saie, as this beyng an arte, ', 'phone'),
('2c9180945109b4c9015109b4cc21037b', TIMESTAMP '2014-08-01 00:00:00.0', 'haggle over a farthing, and shout loud enough to be heard from San ', 'phone'),
('2c9180945109b4c9015109b4cc21037c', TIMESTAMP '2014-02-10 00:00:00.0', 'this thei shall finde, that it hath been difficulte to bryng to passe unto one, who is nombred ', 'email'),
('2c9180945109b4c9015109b4cc22037d', TIMESTAMP '2013-05-13 00:00:00.0', 'In policy virtues may be admitted as useful agents and in the same is to be made more accompt of horses, then in olde ', 'phone'),
('2c9180945109b4c9015109b4cc22037e', TIMESTAMP '2013-11-15 00:00:00.0', 'regimente, chiefly consisteth in warlike skilfulnesse. And therefore the ', 'email'),
('2c9180945109b4c9015109b4cc4303b5', TIMESTAMP '2013-03-05 00:00:00.0', 'bestowed emongeste theirs: The rather undoubtedly, that as by private ', 'phone'),
('2c9180945109b4c9015109b4cc4303b6', TIMESTAMP '2013-05-11 00:00:00.0', 'payed, 197 ', 'email'); 
INSERT INTO PUBLIC.ACTIVITY(ID, DATE, DESCRIPTION, TYPE) VALUES
('2c9180945109b4c9015109b4cc4303b7', TIMESTAMP '2015-01-30 00:00:00.0', 'reasonyng, you shall heare. But concernyng constrainte, you ought to ', 'email'),
('2c9180945109b4c9015109b4cc4303b8', TIMESTAMP '2013-04-22 00:00:00.0', 'for his civil and religious toleration. In England to the Cavaliers he ', 'phone'),
('2c9180945109b4c9015109b4cc5c03ef', TIMESTAMP '2013-03-19 00:00:00.0', 'warre into his auncient orders, if I have not reduced it, I cannot be of ', 'email'),
('2c9180945109b4c9015109b4cc5d03f0', TIMESTAMP '2013-04-05 00:00:00.0', 'the election of Julius II., and in 1506 is again sent to negotiate with ', 'email'),
('2c9180945109b4c9015109b4cc5d03f1', TIMESTAMP '2013-09-03 00:00:00.0', 'illustration he criticises, in a final and damning analysis, the career ', 'phone'),
('2c9180945109b4c9015109b4cc5d03f2', TIMESTAMP '2014-03-04 00:00:00.0', 'for as much as a wise common ', 'phone'),
('2c9180945109b4c9015109b4cc5d03f3', TIMESTAMP '2015-01-09 00:00:00.0', 'must. He should, if possible, practise goodness, but under necessity ', 'email'),
('2c9180945109b4c9015109b4cc740427', TIMESTAMP '2014-10-14 00:00:00.0', 'shall give thee moste reputacion. More over, makyng the ordinaunce to ', 'phone'),
('2c9180945109b4c9015109b4cc740428', TIMESTAMP '2015-02-07 00:00:00.0', 'COSIMO. What waie ought to bee used then? ', 'phone'),
('2c9180945109b4c9015109b4cc740429', TIMESTAMP '2013-07-27 00:00:00.0', 'world, and a larger share in breaking the chains and lighting the dark ', 'email');      
